import java.util.ArrayList;import java.util.List;public class Notebook {    private List<Note> notes = new ArrayList<>();    private String notebookName;    public Notebook(String notebookName) {        this.notebookName = notebookName;    }    public List<Note> getNotes() {        return notes;    }    public void setNotes(List<Note> notes) {        this.notes = notes;    }    public String getNotebookName() {        return notebookName;    }    public void setNotebookName(String notebookName) {        this.notebookName = notebookName;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        Notebook notebook = (Notebook) o;        if (!getNotes().equals(notebook.getNotes())) return false;        return notebookName.equals(notebook.notebookName);    }    @Override    public int hashCode() {        int result = getNotes().hashCode();        result = 31 * result + notebookName.hashCode();        return result;    }}